import axios from 'axios';


export default function idCheck(id) {
    alert(id);
    axios(
        {
            url: '/member/select',
            method: 'get',
            data:{'id2':id},
            baseURL: 'http://localhost:8888',
            withCredentials: true,
        }
    ).then(function() {
          alert("yes");
    });
}
